import React from 'react'
import DateNow from './DateNow'

const Profile = ({ year, month, day, isLogin, name, secondName }) => {
  return (
    <div className='profile'>
      {
        isLogin === true
        ? <>
            <DateNow year={year} month={month} day={day}/>
            <h1 className='nowday-title'>Hello {name} {secondName}</h1>
          </>
        : <div className='btn-group'>
            <button className='btn btn-profile-log'>Войти</button>
            <button className='btn btn-profile-log'>Регистрация</button>
          </div>
      }

    </div>
  )
}

export default Profile
